    inp captcha2

captcha1 :: String -> String
captcha1 = show . solve1 . fromString

captcha2 :: String -> String
captcha2 = show . head . solve2 . fromString

-- ----------------------------------------

type Rectangle = (Int, Rect)
type Rect      = (Point, Point)
data Point     = P !Int !Int deriving (Eq, Ord, Show)
type Count     = Sum Int

newtype Covered   = CM (M.Map Point (Sum Int)) deriving (Eq, Show)

instance Semigroup Covered where
  CM m1 <> CM m2 = CM $ M.unionWith (<>) m1 m2

instance Monoid Covered where
  mempty = CM mempty

foldMapCM :: Monoid m => (Count -> m) -> Covered -> m
foldMapCM f (CM m) = foldMap f m


intersectCM :: Covered -> Covered -> Covered
CM m1 `intersectCM` CM m2 =
  CM $ M.intersection m1 m2

-- ----------------------------------------

solve1 :: [Rectangle] -> Int
solve1 = getSum . foldMapCM cov2count . foldMap rect2covered . map snd

rect2covered :: Rect -> Covered
rect2covered (P x y, P w h) = CM $ M.fromList $
  [ (P x' y', Sum 1)
  | x' <- [x .. x + w - 1]
  , y' <- [y .. y + h - 1]
  ]

cov2count :: Count -> Count
cov2count (Sum i) = Sum . fromEnum $ i >= 2

-- ----------------------------------------

solve2 :: [Rectangle] -> [Int]
solve2 rs = map fst . filter (isSingle . snd) $ rs
  where
    covered :: Covered
    covered = foldMap rect2covered . map snd $ rs

    isSingle :: Rect -> Bool
    isSingle r = c == c2
      where
        c  = rect2covered r
        c2 = covered `intersectCM` c

-- ----------------------------------------

type SP = Parsec () String

fromString :: String -> [Rectangle]
fromString = map pr . lines
  where
    pr :: String -> Rectangle
    pr s = maybe (error "no parse") id $ parseMaybe pRectangle s

    pNum :: SP Int
    pNum = read <$> some digitChar

    pPair :: Char -> SP Point
    pPair c = P <$> (pNum <* char c) <*> pNum

    pRectangle :: SP Rectangle
    pRectangle = do
      n  <- char '#' *> pNum
      xy <- space *> char '@' *> space *> pPair ','
      wh <- char ':' *> space *> pPair 'x' <* space
      return (n, (xy, wh))

